import React from "react";

const Home = () => {
  return (
    <div className="container">
      <h1 className="text-center">Admin Panel</h1>
      <div className="container border border-1 border-dark">
        <div className="row">
          <div className="col-md-3"></div>
          <div className="col-md-3"></div>
          <div className="col-md-3"></div>
          <div className="col-md-3"></div>
        </div>
      </div>
    </div>
  );
};

export default Home;
